import React from 'react';
import '../styles/app.css';

function Contact(){
    return(
        <div>
        <h2>Contact Information</h2>
        <p>Email: example@example.com</p>
        <p>Phone: 123-456-7890</p>
      </div>
    );
}

export default Contact;
